function MyBooks() {
  const [books, setBooks] = useState([
    {
      id: 1,
      title: "Ìï¥Î¶¨Ìè¨ÌÑ∞",
      author: "J.K. Î°§ÎßÅ",
      status: "read",
      memo: "Ïû¨Î∞åÏóàÏùå!",
      rating: 5,
      startDate: "2024-01-01",
      endDate: "2024-01-10",
      createdAt: "2024-01-11",
    },
    {
      id: 2,
      title: "ÌÅ¥Î¶∞ ÏΩîÎìú",
      author: "Î°úÎ≤ÑÌä∏ ÎßàÌã¥",
      status: "to-read",
      memo: "",
      rating: 0,
      startDate: "",
      endDate: "",
      createdAt: "2024-02-05",
    },
    {
      id: 3,
      title: "ÏûêÎ∞îÏä§ÌÅ¨Î¶ΩÌä∏ ÏôÑÏ†ÑÏ†ïÎ≥µ",
      author: "ÌôçÍ∏∏Îèô",
      status: "reading",
      memo: "Ï§ëÎ∞òÎ∂Ä Ïñ¥Î†§ÏõÄ",
      rating: 0,
      startDate: "2024-03-01",
      endDate: "",
      createdAt: "2024-03-05",
    },
    {
      id: 4,
      title: "Ïñ¥Î¶∞ ÏôïÏûê",
      author: "ÏÉùÌÖçÏ•êÌéòÎ¶¨",
      status: "read",
      memo: "Ïù∏ÏÉùÏ±Ö",
      rating: 4,
      startDate: "2023-12-20",
      endDate: "2023-12-25",
      createdAt: "2023-12-26",
    },
  ]);

  const [selectedStatus, setSelectedStatus] = useState("read");
  const [sortOption, setSortOption] = useState("latest");

  const getStatusLabel = (status) => {
    if (status === "read") return "Îã§ ÏùΩÏùÄ Ï±Ö";
    if (status === "reading") return "ÏùΩÎäî Ï§ë";
    if (status === "to-read") return "ÏùΩÍ≥† Ïã∂ÏùÄ Ï±Ö";
  };

  const handleDelete = (id) => {
    const updated = books.filter((book) => book.id !== id);
    setBooks(updated);
  };

  const handleSort = (a, b) => {
    if (sortOption === "latest") {
      return new Date(b.createdAt) - new Date(a.createdAt);
    }
    if (sortOption === "rating") {
      return b.rating - a.rating;
    }
    return 0;
  };

  const filteredBooks = books
    .filter((book) => book.status === selectedStatus)
    .sort(handleSort);

  return (
    <div>
      <h1>üìö ÎÇ¥ ÎèÖÏÑúÍ∏∞Î°ù</h1>

      <div>
        <button onClick={() => setSelectedStatus("read")}>Îã§ ÏùΩÏùÄ Ï±Ö</button>
        <button onClick={() => setSelectedStatus("reading")}>ÏùΩÎäî Ï§ë</button>
        <button onClick={() => setSelectedStatus("to-read")}>ÏùΩÍ≥† Ïã∂ÏùÄ Ï±Ö</button>
      </div>

      <div>
        <label>Ï†ïÎ†¨: </label>
        <select
          value={sortOption}
          onChange={(e) => setSortOption(e.target.value)}
        >
          <option value="latest">ÏµúÏã†Ïàú</option>
          <option value="rating">Î≥ÑÏ†ê ÎÜíÏùÄ Ïàú</option>
        </select>
      </div>

      <h2>{getStatusLabel(selectedStatus)}</h2>
      {filteredBooks.length > 0 ? (
        filteredBooks.map((book) => (
          <div key={book.id} style={{ borderBottom: "1px solid #ccc", marginBottom: "10px" }}>
            <strong>{book.title}</strong> - {book.author}
            {book.memo && <div>Î©îÎ™®: {book.memo}</div>}
            {book.rating > 0 && <div>Î≥ÑÏ†ê: {book.rating} / 5</div>}
            {(book.startDate || book.endDate) && (
              <div>
                Í∏∞Í∞Ñ: {book.startDate} ~ {book.endDate}
              </div>
            )}
            <div>
              <button onClick={() => alert("ÏàòÏ†ï Í∏∞Îä•ÏùÄ ÏïÑÏßÅ Ï§ÄÎπÑ Ï§ëÏûÖÎãàÎã§.")}>ÏàòÏ†ï</button>
              <button onClick={() => handleDelete(book.id)}>ÏÇ≠Ï†ú</button>
            </div>
          </div>
        ))
      ) : (
        <p>ÌëúÏãúÌï† Ï±ÖÏù¥ ÏóÜÏäµÎãàÎã§.</p>
      )}
    </div>
  );
}

export default MyBooks;
